const Counter = (props) => {
  const [count, setCount] = useState(0);
  if (count > 5) {
    throw new Error("Crashed...!!!");
  }
  return (
    <>
      <button onClick={() => setCount(count + 1)}> click PLZ</button>
      {count}
    </>
  );
};

export default Counter;
